import React, {useState} from 'react'
import './Home.css';

import Navbar from '../Components/Navbar';
import SideMenu from '../Components/SideMenu';

import {
    Row,
    Col,
    Container,
} from 'react-bootstrap';

export default function Home() {

    const [allMenuItems, setAllMenuItems] = useState([
        { title: 'News' , route: 'link-what-is' },
        { title: 'How to use it' , route: 'link-how-to-use' },
        { title: 'Documentation' , route: 'link-for-devs' }
    ])

    return (
        <>
        <Navbar menuItems={allMenuItems} userData={1} />
        <Container fluid>
            
        <Row>
            <Col lg={2} style={{background: 'white'}} className="p-5">
                <SideMenu />
            </Col>

            <Col lg={10} style={{background: 'blue'}}>
                DASHBOARD
            </Col>

        </Row>

            



        </Container>
        </>
    )
};
